import React from 'react';
import Tile from './components/Tile';
import data from "./components/data"

export default function App() {
    const grid = data.map(sudoku => {
        return(
            sudoku.schema.map(schema =>{
                return(
                    schema.row.map(tile =>{
                        return(<Tile number={tile.n}/>)
                    })
                )
            })

        )
    })
    return (
        <div>
            {grid}
        </div>
    );
}
